import React from "react";
import Table from 'react-bootstrap/Table'

function Layouts(sched1_conflict, sched2_conflict, sched3_conflict) {

    const conflict_hist1 = sched1_conflict;
    const conflict_hist2 = sched2_conflict;
    const conflict_hist3 = sched3_conflict;

    return (
        <div>
            <font color="red"><h1>Conflict Report 1</h1></font>
            <Table class="table table-striped table-bordered table-sm">
                <thead>
                    <tr>
                        <th>Course</th>
                        <th>CRN</th>
                        <th>UID</th>
                        <th>Last</th>
                        <th>First</th>
                        <th>Conflict</th>
                    </tr>
                </thead>
                <tbody>
                    {conflict_hist1["conflict_hist1"].map(conflict => 
                        <tr> 
                            <td>{conflict[0]}</td>
                            <td>{conflict[0]}</td> {/* Each index represent the CRN, UID, First Name, Last Name, and Conflict */}
                            <td>{conflict[1]}</td>
                            <td>{conflict[2]}</td>
                            <td>{conflict[3]}</td>
                            <td>{conflict[4]}</td>
                        </tr>
					)}
                        {console.log(conflict_hist1["conflict_hist1"])}
                        {console.log(conflict_hist1["conflict_hist2"])}
                        {console.log(conflict_hist1["conflict_hist3"])}
                </tbody>
            </Table>
        </div>
    );
}
export default Layouts;
